        Page 1
      </div>
      <button className="h-7 w-8 border-r-2 border-t-2 bg-gray-200 border-solid border-zinc-700 text-center hover:bg-zinc-300 focus:bg-zinc-300 transition duration-90 ease-in-out">
        +
      </button>
    </>
  );
}
